A woman has been dating guy after guy, but it never seems to work out. She's unaware that she's actually been dating the same guy over and over; a shapeshifter who's fallen for her, and is certain he's going to get it right this time.

She figured out after a while that it was the same guy because he does this weird eye twitch. It is something that even shapeshifting can't hide. But she really does like the guy. It just seems to never work out. And obviously the guy like her too hence why he keeps trying so hard. The woman doesn't know what his true form is. The man has decided no more games and reveal his true self. They set up another date from Tinder where they do all their dates. They decided to go to a restaurant to eat, both knowing of course who each other is. 

The woman gets to the restaurant. She spots the man in the photo. Turns out it is him. No disguise. The woman ends up liking the mans normal look. The man is shocked to hear this hence why he has confidence issues and has the power to shapeshift. They hit off we;

